import React from "react";
import SearchBar from "../searchBar/SearchBar.jsx";
import { NavLink } from "react-router-dom";

const Nav = ({onSearch})=>{
  return (
    <div >
    <SearchBar onSearch={onSearch}/>
    <NavLink to='/about'>
    <button>About</button>
    </NavLink>
    <NavLink to='/home'>
    <button>Home</button>
    </NavLink>
    </div>
  )
}

export default Nav;
